import {makeAutoObservable} from "mobx"

export default class bankStore {
    constructor() {
        // TODO Add cards, transactions
        this._banks = [
            {bankId:1, name:"Сбербанк"},
            {bankId:2, name:"Альфабанк"},
            {bankId:3, name:"Т-банк"},
            {bankId:4, name:"Россельхозбанк"},
        ]
        makeAutoObservable(this);
    }

    setBanks(banks) {
        this._banks = banks;
    }
    get banks() {
        return this._banks;
    }
}
